/* styles */
import resets from './layouts/layouts/styleReset.scss';

/* components */
import Head from './common/Head/index';

const Nav = () => {
    return (
        <ul>
            <li><a href="/blog">Blog</a></li>
            <li><a href="/contact">About</a></li>
            <li><a href="/contact">Contact</a></li>
        </ul>
    );
}

export default Nav
